import React from 'react';

export default function Store({ elem }) {
  return (
    <div>
      <p style={{border: '2px solid black'}}>{elem.name}</p>
      <p style={{border: '2px solid black'}}>{elem.Opening_Hours}</p>
    </div>
  );
}
